script: |
  super -f text -I q9782.spq | sort > q9782.out

inputs:
  - name: q9782.spq
    data: |
      SELECT DISTINCT + cor0.col0 + - cor0.col0 * + col2 + 59 * - 92 AS col0 FROM tab2 (FORMAT parquet) AS cor0;
  - name: tab2

outputs:
  - name: q9782.out
    data: |
      -5610
      -7378
      -8351
